import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';
import Page_oleada from '../src/Page_oleada';

const App = () => {
  return (
    <BrowserRouter>
      <div>
        <nav>
              <Link to="/Page_oleada">Page oleada</Link>
        </nav>
      <Routes>
        <Route path="/" exact component={Page_oleada} />
        </Routes>
      </div>
    </BrowserRouter>
  );
};

export default App;
